import React, { Component } from 'react';

class Announce_post extends Component {
    render() { 
        return (  
    <tr>
        <td>{this.props.post.name}</td>
        <td>{this.props.post.date}</td>
        <td><button className="btn btn-info">Delete</button></td>
    </tr>    
        );
    }
}
 
export default Announce_post;
